import React, { useState } from "react";

import FormInput from "../../components/form-input/form-input.component";
import CustomButton from "../../components/custom-button/custom-button.component";
import Dropdown from "../../components/dropdown/Dropdown";
import Checkbox from "../../components/checkbox/checkbox";

import { EntryDiv } from "./entry.styles";

const options = [
  {
    label: "Severe",
    value: "severe",
  },
  {
    label: "Moderate",
    value: "moderate",
  },
  {
    label: "Mild",
    value: "mild",
  },
];

const Entry = () => {
  const [selected, setSelected] = useState(options[0]);
  const [values, setValues] = useState({
    patientId: "",
    patientName: "",
    currentStatus: "",
    bedNo: "",
    ventilator: "",
    error: "",
    loading: false,
    didRedirect: false,
  });
  const handleChange = (name) => (event) => {};
  return (
    <EntryDiv>
      <form className="entry-form">
        <FormInput
          type="text"
          name="patientId"
          value=""
          onChange=""
          label="Patient ID"
          required
        />
        <FormInput
          type="text"
          name="patientName"
          value=""
          onChange=""
          label="Patient Name"
          required
        />
        <Dropdown
          label="Current Status"
          name="currentStatus"
          options={options}
          selected={selected}
          onSelectedChange={setSelected}
        />
        <FormInput
          type="text"
          name="bedNo"
          value=""
          onChange=""
          label="Bed #"
          required
        />
        <Checkbox
          type="text"
          name="ventilator"
          label="Ventilator"
          isSelected=""
          onCheckboxChange=""
          required
        />
        <CustomButton type="submit">Submit</CustomButton>
      </form>
    </EntryDiv>
  );
};

export default Entry;
